  "instructions": "<p>The experience and loot here is average, but it's a good alternative if you need somewhere new to hunt. You can come here as early as level 50 (skills 70/70+). If you hunt conservatively you can make some good profit.</p>\n<p></p>\n<p>üíØ <strong>Experience</strong></p>\n<p>From 150k to 300k of experience per hour, and up to 450k/h on green stamina. The Nightmare floors will make you gain a lot of xp but lose on profit.</p>\n<p></p>\n<p>üí∞ <strong>Loot</strong></p>\n<p>Profit ranges from 0 to 15k/h, depending on your hunt style.</p>\n<p></p>\n<p>The mutated Tigers are pretty much guaranteed profit which will make up for the bog Raiders if you don't get anything. They drop tons of Life Rings, Glorious Axes and even rarely Angelic Axes and Guardian Shields.</p>\n<p></p>\n<p>Bog Raiders don't drop much but they can rarely drop a paladin armor which should turn any hunt profitable.</p>\n<p></p>\n<p>üõ°Ô∏è <strong>Equipment</strong></p>\n<p>Nothing special from what you usually wear but you can choose to wear a Garlic Necklace for the Bog Raiders lifedrain attack if you wish. Silver amulet is not recommended since they'll break quickly from being poisoned.</p>\n<p></p>\n<p>üé°<strong> Rotation</strong></p>\n<p>If you are level 100+, basically do a big loop, pulling monsters into groups to exori (rather than killing one by one), then go down to the laboratory buildings (üìπ 01:09).</p>\n<p></p>\n<p>Otherwise, do the big loop, ignore the buildings (unless you have to wait the respawn) and focus on hunting one by one AND the mutated tiger üêØ to the north (üìπ 02:48).</p>\n<p></p>\n<p>üêª<strong> Tasks</strong></p>\n<ul>\n  <li>Between level 50 and 79, you can task the Mutated Tigers which spawn is great</li>\n  <li>Between level 80 and 129 you can task the Nightmares and Nightmare Scions</li>\n  <li>Above level 130 you can task the Destroyers but there's only three of them in a room, so it's not very good</li>\n</ul>",
